using AutoMapper;
using Business.Features.Product.Commands.CreateProduct;
using Business.Features.Product.Commands.UpdateProduct;
using Business.Wrappers;
using Core.Constants;
using Core.Exceptions;
using Data.Repositories.Product.Read;
using Data.Repositories.Product.Write;
using Data.UnitOfWork;
using Moq;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using static Azure.Core.HttpHeader;

namespace UnitTests.Handles.Product.Command.Product;

public class UpdateProductHandlerTests
{
	private readonly Mock<IProductReadRepository> _productReadRepository;
	private readonly Mock<IProductWriteRepository> _productWriteRepository;
	private readonly Mock<IMapper> _mapper;
	private readonly Mock<IUnitOfWork> _unitOfWork;
	private readonly UpdateProductHandler _handler;
	public UpdateProductHandlerTests()
	{
		_productReadRepository = new Mock<IProductReadRepository>();
		_productWriteRepository = new Mock<IProductWriteRepository>();
		_mapper = new Mock<IMapper>();
		_unitOfWork = new Mock<IUnitOfWork>();

		_handler = new UpdateProductHandler(_unitOfWork.Object, _productWriteRepository.Object, _productReadRepository.Object, _mapper.Object);
	}

	[Fact]
	public async Task Service_WhenProductNotFound_ShouldThrowValidationException()
	{
		//Arrange
		var request = new UpdateProductCommand
		{
			Name = "name",
			Description = "description description",
			Photo = "",
			Price = 1,
			Quantity = 1,
			Type = ProductType.Sold
		};

		_productReadRepository.Setup(x => x.GetAsync(3)).ReturnsAsync(value: null);

		//Act
		Func<Task> func = async () => await _handler.Handle(request, It.IsAny<CancellationToken>());

		//Assert
		var exception = await Assert.ThrowsAsync<NotFoundException>(func);
		Assert.Contains("Product not found", exception.Errors);
	}

	[Fact]
	public async Task Service_WhenValidationIsFailed_ShouldThrowValidationException()
	{
		//Arrange
		var request = new UpdateProductCommand
		{
			Name = "name",
			Description = "description description",
			Photo = "",
			Price = 0,
			Quantity = 1,
			Type = ProductType.Sold
		};
		_productReadRepository.Setup(x => x.GetAsync(request.Id)).ReturnsAsync(new Core.Entities.Product());

		//Act
		Func<Task> func = async () => await _handler.Handle(request, It.IsAny<CancellationToken>());

		//Assert
		var exception = await Assert.ThrowsAsync<ValidationException>(func);
		Assert.Contains("Price must be greater than zero", exception.Errors);
	}

	[Fact]
	public async Task Service_WhenFlowIsSucceded_ShouldReturnResponse()
	{
		//Arrange
		var request = new UpdateProductCommand
		{
			Id = 1,
			Name = "name34324",
			Description = "description description",
			Photo = "",
			Price = 1,
			Quantity = 1,
			Type = ProductType.Sold
		};
		var product = _productReadRepository.Setup(x => x.GetAsync(request.Id)).ReturnsAsync(new Core.Entities.Product());
		_mapper.Setup(x => x.Map(request, product));

		//Act
		var response = await _handler.Handle(request, It.IsAny<CancellationToken>());

		//Assert
		Assert.IsType<Response>(response);
		Assert.Contains("Product updated succesfully", response.Message);
	}
}


